// src/components/Home.js

import React from 'react';

// Sample Images (You can replace these with actual images)
const bannerImage = "https://via.placeholder.com/1500x500";
const dishImage1 = "https://via.placeholder.com/400x300";
const dishImage2 = "https://via.placeholder.com/400x300";
const dishImage3 = "https://via.placeholder.com/400x300";

const Home = () => {
  return (
    <div style={styles.container}>
      {/* Banner Section */}
      <div style={styles.banner}>
        <img src={bannerImage} alt="Restaurant Banner" style={styles.bannerImage} />
        <div style={styles.bannerText}>
          <h1>Welcome to ABC Restaurant</h1>
          <p>Experience the best culinary delights with us</p>
          <button style={styles.exploreButton}>Explore Menu</button>
        </div>
      </div>

      {/* Featured Dishes Section */}
      <div style={styles.section}>
        <h2 style={styles.sectionTitle}>Featured Dishes</h2>
        <div style={styles.dishes}>
          <div style={styles.dishCard}>
            <img src={dishImage1} alt="Dish 1" style={styles.dishImage} />
            <h3>Dish Name 1</h3>
            <p>Description of the dish. Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
          </div>
          <div style={styles.dishCard}>
            <img src={dishImage2} alt="Dish 2" style={styles.dishImage} />
            <h3>Dish Name 2</h3>
            <p>Description of the dish. Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
          </div>
          <div style={styles.dishCard}>
            <img src={dishImage3} alt="Dish 3" style={styles.dishImage} />
            <h3>Dish Name 3</h3>
            <p>Description of the dish. Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
          </div>
        </div>
      </div>

      {/* About Us Section */}
      <div style={styles.section}>
        <h2 style={styles.sectionTitle}>About Us</h2>
        <p style={styles.aboutText}>
          ABC Restaurant is a renowned chain of restaurants across Sri Lanka, known for its exceptional culinary
          offerings and delightful dining experience. Join us for an unforgettable journey of flavors and hospitality.
        </p>
      </div>

      {/* Contact Us Section */}
      <div style={styles.contactSection}>
        <h2 style={styles.sectionTitle}>Contact Us</h2>
        <p>Reach out to us for reservations or queries.</p>
        <button style={styles.contactButton}>Contact Us</button>
      </div>
    </div>
  );
};

// Inline CSS Styles
const styles = {
  container: {
    fontFamily: 'Arial, sans-serif',
    lineHeight: 1.6,
    margin: 0,
    padding: 0,
    boxSizing: 'border-box',
  },
  banner: {
    position: 'relative',
    width: '100%',
    height: '500px',
  },
  bannerImage: {
    width: '100%',
    height: '500px',
    objectFit: 'cover',
    filter: 'brightness(50%)',
  },
  bannerText: {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    color: 'white',
    textAlign: 'center',
  },
  exploreButton: {
    marginTop: '20px',
    padding: '10px 20px',
    backgroundColor: '#ff6347',
    color: 'white',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    fontSize: '16px',
  },
  section: {
    padding: '50px 20px',
    textAlign: 'center',
  },
  sectionTitle: {
    fontSize: '36px',
    marginBottom: '30px',
  },
  dishes: {
    display: 'flex',
    justifyContent: 'space-around',
    flexWrap: 'wrap',
  },
  dishCard: {
    width: '300px',
    margin: '20px',
    textAlign: 'center',
  },
  dishImage: {
    width: '100%',
    borderRadius: '10px',
  },
  aboutText: {
    maxWidth: '800px',
    margin: '0 auto',
    fontSize: '18px',
    color: '#555',
  },
  contactSection: {
    backgroundColor: '#ff6347',
    color: 'white',
    padding: '40px 20px',
  },
  contactButton: {
    marginTop: '20px',
    padding: '10px 20px',
    backgroundColor: 'white',
    color: '#ff6347',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    fontSize: '16px',
  },
};

export default Home;
